      Kind for Congress Committee (committee) on June 2, 2009.  On September 23, 2009,
      the committee informed the PAC that the check was lost.  That same day, the
      PAC placed a stop payment order with its bank and issued a new $1000 contribution
      to the committee.  Appropriate entries were made in the PACs October 2009 monthly
      report.  Within the past two weeks, the PAC learned that the lost check had
      been deposited in the committees account on August 2 and paid by the PACs bank
      on August 6, despite the stop payment order.  On September 13, 2010, a representative
      of the PAC discussed this matter with the committee, and the PAC determined
      that same day that it would allow the committee to retain the additional $1000
      contribution and would not request a refund.'
